import profileImage from './public/Assets/profile.png';

const CirclePage = () => {
  return (
    <div className="Section"> 
      <div className='Middle'>
        <h1>Hello Dev</h1>
        <h2>I am Subarna Dahal</h2>
      </div>
      <div className='image'>
        <img src={profileImage} alt="subarna" />
      </div>
    </div>
  );
}

export default CirclePage;
